     // 'easeOutBack',
     // 'easeOutBounce',
     // 'easeOutCirc',
     // 'easeOutCubic',
     // 'easeOutElastic',
     // 'easeOutExpo',
     // 'easeOutInBack',
     // 'easeOutInBounce',
     // 'easeOutInCirc',
     // 'easeOutInCubic',
     // 'easeOutInElastic',
